import * as React from 'react';
import { Text, View } from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import { createMaterialTopTabNavigator } from '@react-navigation/material-top-tabs';

import AllOrders from "../../components/Orders/AllOrder";
import PendingOrders from "../../components/Orders/PendingOrders";
import DeliveringOrders from "../../components/Orders/DeliveringOrders";
import DoneOrders from "../../components/Orders/DoneOrders";
import CanceledOrders from "../../components/Orders/CanceledOrders";

const Tab = createMaterialTopTabNavigator();

export default function OrderScreen() {
  return (
    <Tab.Navigator
      tabBarOptions={{
        scrollEnabled: true
      }}
      screenOptions={{
        tabBarItemStyle: { width: 130 },
        tabBarStyle: { backgroundColor: '#99ccff' },
      }}
    >
      <Tab.Screen name="Tất cả đơn" component={AllOrders} />
      {/* <Tab.Screen name="Chờ giao hàng" component={PendingOrders} />
      <Tab.Screen name="Đang giao " component={DeliveringOrders} />
      <Tab.Screen name="Đã giao hàng" component={DoneOrders} />
      <Tab.Screen name="Đơn đã hủy" component={CanceledOrders} /> */}
    </Tab.Navigator>
  );
}
